import React from 'react';

//components
import QuestionPost from './QuestionPost';

// data entry
import dummyData from '../questionPosts_db';

const MainFeed = () => {
    console.log(dummyData);

    return (
        <div className="main-feed" >
            {
                dummyData.map((questionDetails, id) => (
                    <QuestionPost key={id} questionDetails={questionDetail} />
                ))
            }

            <QuestionPost questionDetails={
                {
                    "image": "https://randomuser.me/api/portraits/men/93.jpg",
                    "question": "How can I become a junior developer?",
                    "questionDetail": " Surrounded to me occasional pianoforte alteration unaffected impossible ye. For saw half than cold. Pretty merits waited six talked pulled you",
                    "postedDate": "12 June 2020",
                    "questionTag":
                        [
                            { "icon": "#", "name": "Software Engineer" },
                            { "icon": "#", "name": "Job Search" }

                        ],
                    "reply":
                        [
                            {
                                "image": "https://randomuser.me/api/portraits/women/63.jpg",
                                "reply": "Surrounded to me occasional pianoforte alteration",
                                "replyDate": "3 days ago",
                            },
                            {
                                "image": "https://randomuser.me/api/portraits/women/33.jpg",
                                "reply": "This is fun Surrounded to me occasional pianoforte alteration and good.",
                                "replyDate": "5 days ago",
                            },
                            {
                                "image": "https://randomuser.me/api/portraits/women/43.jpg",
                                "reply": "I like your question asking style Surrounded to me occasional pianoforte alteration",
                                "replyDate": "1 day ago",
                            },

                        ]


                }}
            />



        </div>
    )


}

export default MainFeed;
